import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M2.5 3a.5.5 0 000 1h15a.5.5 0 000-1h-15zm0 13a.5.5 0 000 1h15a.5.5 0 000-1h-15zM4 13c0 1.1.9 2 2 2h1a2 2 0 002-2V7a2 2 0 00-2-2H6a2 2 0 00-2 2v6zm9 2a2 2 0 01-2-2V7c0-1.1.9-2 2-2h1a2 2 0 012 2v6a2 2 0 01-2 2h-1z", fill: primaryFill }));
};
const AlignStretchVertical20Filled = wrapIcon(rawSvg({}), 'AlignStretchVertical20Filled');
export default AlignStretchVertical20Filled;
